import React, { useState, useEffect, Fragment } from "react";
import Navbar from "../../Components/Navbar";
import SubjectsList from "../../Components/SubjectsList";
import axios from "axios";
import { ToastContainer, toast } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";
import { useLocation } from "react-router-dom";



function Subjects() {
  const [data, setData] = useState([]);

  const location = useLocation();

  useEffect(() => {
    axios
      .get(
        `https://localhost:7151/api/Subject/GetSubject/${location.state.studentId.studentId}`
      )
      .then((result) => {
        setData(result.data);
        toast.success(result.data.mark);
      })
      .catch((error) => {
        toast.error(error.toString());
      });
  }, [location.state.studentId.studentId]);

  return (
    <>
      <Fragment>
        <ToastContainer />
        <Navbar
          text={
            location.state.studentFirstName.firstName +
            " " +
            location.state.studentLastName.lastName +" "+data.subjectName
          }
        />
        <SubjectsList subjectsData={[data]}></SubjectsList>
      </Fragment>
    </>
  );
}

export default Subjects;
